    margin-bottom:0;
`

const CourseInfo = ({ course }) => {
    const [edit, setEdit] = useState(false)

    return (
        <Paper>
            <div className="p-3">
                <Header>
                    Chi tiết môn học
                </Header>
            </div>
            <Divider />

        </Paper>
    )
}

